    "daily-and-sub-daily-precipitation-for-the-former-ussr",nt"isopen": false,nt"url":
    null,nt"notes": "This dataset is a compilation of in situ daily and hourly
    meteorological observations for the former USSR initially obtained within the framework
    of several joint projects of All-Russian Research Institute for Hydrometeorological
    Information-World Data Center of the Federal Service for Hydrometeorology and Environmental
    Monitoring, Obninsk, Russian Federation, and (former) NOAA National Climatic Data
    Center, Asheville, North Carolina. The data in this archive have been compiled from
    several sources beginning is 1891, with Russian data available to 2000, but other
    newly independent states data only to 1991. Homogenization and bias-correction are
    done only when appropriate metadata and supplementary synoptic information are available.",nt"license_title":
